import React from 'react';
import Slider from '../../Component/Slider';



function Home() {
  return (
    <div>
      <Slider/>
      <section className="section bg-c-light border-top">
        <div className="container">
          <div className="row">
            <div className="col-md-12 nb-4 text-cent">

            </div>

          </div>

        </div>

      </section>
    </div>
  );
}

export default Home;
